import card1 from "../images/1.jpg";
const img = [];
const HomeDetails = [
  {
    image: { ...img, card1 },
    amount: "500rs",
    item: "jeans shirt",
  },
  {
    image: { card1 },
    amount: "600rs",
    item: "black shirt",
  },
  {
    image: { card1 },
    amount: "700rs",
    item: "red shirt",
  },
];
export default HomeDetails;
